import argparse

def rem_to_px(rem_value, root_font_size):
    return int(rem_value * root_font_size)
def em_to_px(em_value, parent_font_size):
    return int(em_value * parent_font_size)
def rem_to_em(rem_value, root_font_size, parent_font_size):
    return int(rem_value * root_font_size / parent_font_size)

def main():
    parser = argparse.ArgumentParser(description='Convert nilai (REM, EM) to PX')
    parser.add_argument('--rem', type=int, help='Convert REM to PX')
    parser.add_argument('--em', type=int, help='Convert EM to PX')
    parser.add_argument('--remToEm', type=int, help='Convert REM to EM')

    args = parser.parse_args()

    root_font_size = 16
    parent_font_size = 16

    if args.rem:
        px_value = rem_to_px(args.rem, root_font_size)
        print(f'{args.rem} REM sama dengan {px_value} PX')

    if args.em:
        px_value = em_to_px(args.em, parent_font_size)
        print(f'{args.em} EM sama dengan {px_value} PX')

    if args.remToEm:
        em_value = rem_to_em(args.remToEm, root_font_size, parent_font_size)
        print(f'{args.remToEm} REM sama dengan {em_value} EM')

if __name__ == '__main__':
    main()

int Solution::solve(vector<vector<int> > &A) {
    priority_queue<pair<int,pair<int,int>>,vector<pair<int,pair<int,int>>>,greater<pair<int,pair<int,int>>>> q;
    
    q.push({A[0][0],{0,0}});
     q.push({A[0][1],{1,0}});
      q.push({A[0][2],{2,0}});
    vector<int> hPaint(A.size(),-1);
    vector<int> hCost(A.size(),1e7);
    while(!q.empty()) {
        auto element = q.top();
        q.pop();
        int cost=element.first;
        int color = element.second.first;
        int no = element.second.second;
        if(no==A.size()-1) {
             if(hPaint[no-1]!=color) return cost;
        }
        if(cost<hCost[no]) {
            if(no==0 || (hPaint[no-1]!=color)) {
            hCost[no] = cost;
            hPaint[no] = color;
            } else continue;
        } else { continue; }
        
        
            
     q.push({A[no+1][1]+cost,{1,no+1}});
      q.push({A[no+1][2]+cost,{2,no+1}});
       q.push({A[no+1][0]+cost,{0,no+1}});
       
    
}
return 1;
}

class PVBuilderCmdWnd extends UICommonAPI;  // only ride 
var string m_WindowName;
var WindowHandle Me;
var EditBoxHandle RideId_EditBox;
var ButtonHandle Ride_button;

function OnLoad()
{
	local string pawnViewerMode;

	SetClosingOnESC();
	Me = GetWindowHandle( "PVBuilderCmdWnd" );
	
	if(GetINIString("URL", "L2PawnViewerMode", pawnViewerMode, "l2.ini"))
	{
		Me.SetWindowTitle("BuilderCommand" @ "(" $ pawnViewerMode $ ")");
	}	
	
    Ride_button = GetButtonHandle( m_WindowName$".Ride_button" );	
	RideId_EditBox = GetEditBoxHandle( m_WindowName$".RideId_EditBox" );
	RideId_EditBox.SetString("13330");
	
}	
	
	function OnClickRefreshButton()
{	
	local string ride_id;
	ride_id = RideId_EditBox.GetString();	
	ExecuteCommand("///ride id="$ride_id ); 
	
}
	
function OnClickButton( String a_ButtonID )
{
	switch( a_ButtonID )
	{	 
      case "Ride_button":
			if( Ride_button.GetButtonName() == "Ride" )
			{
				ExecuteCommand("///ride_id=" @ RideId_EditBox.GetString());
				Ride_button.SetNameText( "Unride" );
				break;
			}
			else
			{
				ExecuteCommand( "///unride" );
				Ride_button.SetNameText( "Ride" );
				break;
			}	
		
	}
	
}

